      out.write("\t\t\t\t\t\t\t1980년~1990년 후반까지 길거리에서 쉽게 볼 수 있던 포장마차는 퇴근길 맛있는 안주로 출출함을 달래주고 피로를 녹여주었으며,<br/>\r\n");
      out.write("\t\t\t\t\t\t\t특유의 정겨운 분위기로 많은 이들의 발걸음을 붙잡았습니다. 한신포차는 이러한 길거리 포장마차의 분위기를 실내<br/>\r\n");
      out.write("\t\t\t\t\t\t\t에 연출한 대한민국 최초의 대형 실내 포장마차로써,<br/>\r\n");
      out.write("\t\t\t\t\t\t\t20여 년이 흐른 오늘날까지 특유의 분위기와 한신닭발, 옛날통닭, 해물모둠볶음 등의 특별한 안주로 많은 사랑을 받고 있습니다.\r\n");
      out.write("\t\t\t\t\t\t</p>\r\n");
