      out.write("\t\t\t\t\t\t\t한신닭발\r\n");
      out.write("\t\t\t\t\t\t</h2>\t\t\t\t\t\t\r\n");
      out.write("\t\t\t\t\t</div>\r\n");
      out.write("\t\t\t\t\t<div class=\"main_text_p\">\r\n");
      out.write("\t\t\t\t\t\t<p class=\"slide_sentence\">\r\n");
      out.write("\t\t\t\t\t\t\t보글보글 끓여 먹는 매운 국물 닭발의 원조! 한신닭발은 화끈하고 부드러운 맛으로 많은 사랑을 받고 있는 한신포차의 대표 메뉴입니다. 콩나물<br/>\r\n");
      out.write("\t\t\t\t\t\t\t을 넣어 아삭한 식감을 더하고, 동글동글 직접 만들어 먹는 셀프주먹밥을 추가하여 맛을 한층 더 풍부하게, 그리고 닭발을 다 먹은 후 남은 양념<br/>\r\n");
      out.write("\t\t\t\t\t\t\t에 밥을 볶아 마무리 하며 한신닭발을 완벽하게 즐겨보세요!\r\n");
